import React from 'react';

import '../news.css'
import News from '../news/allNews/news'

class NewsRoute extends React.Component {
  state = { expanded: false };

  handleExpandClick = () => {
    this.setState(state => ({ expanded: !state.expanded }));
  };

  render() {

    return (
    <div>
        <News />

    </div>
    );
  }
}

export default NewsRoute;
